import "./Plan.css";

const Plan = () => {
  return (
    <div className="plans">
      {/* Header */}
      <div
        className="program-header"
        style={{ gap: "2rem", paddingTop: "-2rem" }}
      >
        <span className="text-stroke">ready to start</span>
        <span>your journey</span>
        <span className="text-stroke">now with us</span>
      </div>
    </div>
  );
};

export default Plan;
